<script>
export default {
  data() {
    return {
      flippedCard: null,
      quantity: {
        month: 1,
        quarter: 1,
        year: 1
      },
      prices: {
        month: 50,
        quarter: 135,
        year: 500
      }
    };
  },
  computed: {
    totalPrice() {
      return {
        month: this.prices.month * this.quantity.month,
        quarter: this.prices.quarter * this.quantity.quarter,
        year: this.prices.year * this.quantity.year
      };
    }
  },
  methods: {
    flipCard(card) {
      if (this.flippedCard === card) {
        this.flippedCard = null;
      } else {
        this.flippedCard = card;
      }
    },
    pay(type) {
      alert(`支付类型：${type}\n总价：${this.totalPrice[type]}元`);
    }
  }
};
